 (6,'SPORTS','BATMITON','BATMITON','Olympics','exhibition sport','Olympic Games ','Badminton was first held as a demonstration sport at the 1972 Summer Olympics. In 1988 it again appeared at the Olympics as an exhibition sport','o	Badminton was first held as a demonstration sport at the 1972 Summer Olympics. In 1988 it again appeared at the Olympics as an exhibition sport. Badminton premiered as a full-medal Olympic sport at the 1992 Olympic Games in Barcelona, Spain, and has continued as a full-medal sport since then. There are tournaments for men and women, singles and doubles. A Mixed Doubles event was added to the Olympic Games for the first time in Atlanta in 1996. Players qualify for the Olympic Games through their world rankings, based on their performances in such events as the Thomas Cup, the Uber Cup, the World Championships, Grand Prix events and other international and continental championships. The host nation is allowed at least two entries in the Olympic competition.',,'1','12:20 31/01/2017','magi');
