 (7,'SPORTS','BATMITON','BATMITON','Olympics','exhibition sport','Olympic Games ','Badminton was first held as a demonstration sport at the 1972 Summer Olympics. In 1988 it again appeared at the Olympics as an exhibition sport','o	Badminton was first held as a demonstration sport at the 1972 Summer Olympics. In 1988 it again appeared at the Olympics as an exhibition sport. Badminton premiered as a full-medal Olympic sport at the 1992 Olympic Games in Barcelona, Spain, and has continued as a full-medal sport since then. There are tournaments for men and women, singles and doubles. A Mixed Doubles event was added to the Olympic Games for the first time in Atlanta in 1996. Players qualify for the Olympic Games through their world rankings, based on their performances in such events as the Thomas Cup, the Uber Cup, the World Championships, Grand Prix events and other international and continental championships. The host nation is allowed at least two entries in the Olympic competition.',,'0','12:20 31/01/2017','magi'),
 (8,'SPORTS','BOXING','BOXING','Olympics','banned','Olympic Games ','Boxing has been contested at every Summer Olympic Games since 1904, except for in 1912 in Stockholm as Swedish law banned the sport at the time','Boxing has been contested at every Summer Olympic Games since 1904, except for in 1912 in Stockholm as Swedish law banned the sport at the time. In 2009, the IOC voted to include women\'s boxing at the 2012 London Games, so now there are men and women competing in all Olympic sports. In 2016\r\nFeatherweight weight was dropped in 2012 and the weight limits adjusted for Fly and Bantam classes, leaving 10 weight classes from light flyweight to super-heavyweight. For the female boxers, the three weight divisions are flyweight, lightweight and middleweight. The male boxing bouts are contested over three 3-minute rounds, female bouts are four 2-minute rounds. Under Swedish law, boxing was not allowed at the 1912 Stockholm Games. This is the only time that boxing has not been on the program since it was introduced in 1904., head guards were scrapped for the men and electronic scoring replaced',,'0','12:24 31/01/2017','magi');
