 (19,'SPORTS','HANDBALL','HANDBALL','Olympics','sport','Olympic Games ','A Mixed Doubles event was added to the Olympic Games for the first time in Atlanta in 1996. Players qualify for the Olympic Games through their world rankings, based on their ','Basketball was admitted as an Olympic sport for the first time in 1936 in Berlin, and has been on the program ever since. A women\'s basketball tournament was added in 1976.\r\nIn 1936, the first ever final was played on a dirt court in the rain, which made dribbling impossible. The United States team beat Canada 19 to 8.\r\nIn 1972, the U.S. basketball team lost a game for the first time, defeated by the Soviet Union. However, the US team refused to accept the silver medal, claiming that the clock had been improperly restarted in the final moments.\r\nIn 1992, with the door open to professional athletes, the U.S. sent a \'Dream Team\' including Charles Barkley, Larry Bird, Magic Johnson, Michael Jordan, and Karl Malone. As expected, they went undefeated throughout the tournament.\r\n',,'2','12:33 31/01/2017','kumar'),
 (20,'PEOPLES','FAMOUSPERSON','BIOGRAPHY MOTHER TERESA','Teresa','Nobel Peace','serving','Roman Catholic nun who devoted her life to serving the poor and destitute around the world. She spent many years in Calcutta, India where she founded the Missionaries of Charity, a religious congregation devoted to helping those in great need. In 1979, Mother Teresa was awarded the Nobel Peace Prize and became a symbol of charitable, selfless work. In 2016, Mother Teresa was canonised','Mother Teresa (19101997) was a Roman Catholic nun who devoted her life to serving the poor and destitute around the world. She spent many years in Calcutta, India where she founded the Missionaries of Charity, a religious congregation devoted to helping those in great need. In 1979, Mother Teresa was awarded the Nobel Peace Prize and became a symbol of charitable, selfless work. In 2016, Mother Teresa was canonised by the Roman Catholic Church as Saint Teresa.',,'0','15:01 06/02/2017','magi');
