 (21,'TOURIST','FAMOUSPLACE','HAWA MAHAL','famous place Jaipur','household','royal household','India, so named because it was essentially a high screen wall built','Hawa Mahal is a palace in Jaipur, India, so named because it was essentially a high screen wall built so the women of the royal household could observe street festivals while unseen from the outside',,'0','15:08 06/02/2017','magi'),
 (22,'POLITICAL','POTITICAL','PRIME MINISTER','politicians','Ahmed Ouyahia','Abdelmalek','Likely successors remain machine politicians such','Likely successors remain machine politicians such as Prime Minister Abdelmalek Sellal or former Prime Minister Ahmed Ouyahia, who would be unlikely to radically change things, even though economic modernisation, if not political reform, is central to their discourse...',,'0','15:12 06/02/2017','magi');
INSERT INTO `documentup` (`id`,`catego`,`caption`,`filenmae`,`key1`,`key2`,`key3`,`descrip`,`files`,`image`,`ratings`,`date`,`username`) VALUES 
 (23,'POLITICAL','POTITICAL','PRIME MINISTER','Indian National','GandhiSonia','affairs','Sonia GandhiSonia Gandhi is about to complete 15 years as the President of the','Sonia GandhiSonia Gandhi is about to complete 15 years as the President of the Indian National Congress Party. Keeping the grand old party of India under check and voicing her opinions ever so often on the state of the affairs in the country. Sonia Gandhis legacy will never be fully known unless somebody spills the beans on how much influence she actually wields in government decisions. She is known to have played an important role in passing important bills such as National Rural Employment Guarantee Scheme and the Right to Information Act. The cash transfers scheme for poor people is the latest initiative from Sonia Gandhi.',,'0','15:15 06/02/2017','magi'),
 (24,'TOURIST','FAMOUSPERSON','HUMAYUNS TOMB','Delhi','Mirak Mirza','touristplace','Humayun\'s tomb is the tomb of the Mughal Emperor Humayun in Delhi','Humayun\'s tomb is the tomb of the Mughal Emperor Humayun in Delhi, India. The tomb was commissioned by Humayun\'s first wife and chief consort, Empress Bega Begum, in 1569-70, and designed by Mirak Mirza Ghiyas, a Persian architect chosen by her',,'0','15:18 06/02/2017','magi');
INSERT INTO `documentup` (`id`,`catego`,`caption`,`filenmae`,`key1`,`key2`,`key3`,`descrip`,`files`,`image`,`ratings`,`date`,`username`) VALUES 
 (25,'PEOPLES','FAMOUSPERSON','BIOGRAPHY NELSON MANDELA','jointly','African political','leader','democratic South Africa.','Nelson Mandela (1918  2013) was a South African political activist who spent over 20 years in prison for his opposition to the apartheid regime. He was released in 1990 and, in 1994, was later elected the first leader of a democratic South Africa. He was awarded the Nobel Peace Prize (jointly with F.W. de Klerk) in 1993 for his work in helping to end racial segregation in South Africa. He is considered the father of a democratic South Africa and widely admired for his ability to bring together a nation, previously divided by apartheid. Nelson Mandela is one of the most admired political leaders of the Twentieth and Twenty First Century for his vision to forgive and forge a new rainbow nation.',,'0','15:20 06/02/2017','magi'),
 (26,'PEOPLES','FAMOUSPERSON','BILL GATES','famous persons','firstplace','money man','Basketball was admitted as an Olympic sport for the first time in 1936 in Berlin, and has been on the program ever since','harles de Gaulle (22 November 1890  9 November 1970) was a French general and statesman who acted as leader of the Free French during the Second World War. One of the most influential French politicians of the Twentieth Century, he helped found the Fifth Republic in 1958 and served as its first President from 1959 to 1969. He was a right wing conservative and was a keen French Nationalist. His brand of right wing conservatism is branded Gaullism.',,'1','15:21 06/02/2017','kumar');
INSERT INTO `documentup` (`id`,`catego`,`caption`,`filenmae`,`key1`,`key2`,`key3`,`descrip`,`files`,`image`,`ratings`,`date`,`username`) VALUES 
 (27,'PEOPLES','FAMOUSPERSON','CHARLES','famous persons','French politicians','Twentieth Century','he helped found the Fifth Republic in 1958 and served as its first President from 1959 to 1969. He was a right wing conservative and was a keen French Nationalist. His brand of right wing conservatism is branded','harles de Gaulle (22 November 1890  9 November 1970) was a French general and statesman who acted as leader of the Free French during the Second World War. One of the most influential French politicians of the Twentieth Century, he helped found the Fifth Republic in 1958 and served as its first President from 1959 to 1969. He was a right wing conservative and was a keen French Nationalist. His brand of right wing conservatism is branded Gaullism.',,'0','15:23 06/02/2017','kumar'),
 (28,'POLITICAL','PRIMEMINISTER','PRIME MINISTER','Sonia Gandhi','Congress Party','President','Sonia GandhiSonia Gandhi is about to complete 15 years as the President of the Indian National Congress Party. Keeping the grand old party of India under check and voicing her opinions ever so often on the state of the affairs in the country. Sonia Gandhi?s legacy will never be fully known unless somebody spills the beans on how much influence she actually wields in government decisions. She is known to have played an important role in passing important bills such as National Rural Employment Guarantee Scheme','Sonia GandhiSonia Gandhi is about to complete 15 years as the President of the Indian National Congress Party. Keeping the grand old party of India under check and voicing her opinions ever so often on the state of the affairs in the country. Sonia Gandhis legacy will never be fully known unless somebody spills the beans on how much influence she actually wields in government decisions. She is known to have played an important role in passing important bills such as National Rural Employment Guarantee Scheme and the Right to Information Act. The cash transfers scheme for poor people is the latest initiative from Sonia Gandhi.',,'0','15:25 06/02/2017','kumar');
INSERT INTO `documentup` (`id`,`catego`,`caption`,`filenmae`,`key1`,`key2`,`key3`,`descrip`,`files`,`image`,`ratings`,`date`,`username`) VALUES 
 (29,'PEOPLES','PRIMEMINISTER','JOHN  KENNEDY','elected president','elected president','Kennedy','John F Kennedy was America?s second youngest elected president','John F Kennedy was Americas second youngest elected president. He oversaw one of the most crucial moments in the Cold War (Cuban Missile Crisis) and sought to affirm Americas beliefs in basic human rights by calling for civil rights legislation and an attack on poverty and degradation. Assassinated in November 22, 1963, his tragic death shocked America and the world.\r\n\r\nBorn in May 1917, John F. Kennedy came from an illustrious political family; his father Joseph Kennedy was a leading member of the Democrat party and Joseph encouraged John F. Kennedy in his political ',,'0','15:31 06/02/2017','kumar'),
 (30,'PEOPLES','PRIMEMINISTER','MONROE','Pacific','Second','Dougherty','Monroe married Jimmy Dougherty,','Monroe married Jimmy Dougherty, in 1942. When he left to the South Pacific to fight in the Second world War, she joined a local munitions factory in Burbank, California. It was here that Marilyn got her first big break. Photographer David Conover, was covering the munitions factory to show women at work. He was struck by the beauty and photogenic nature of Norma, and he used her in many of her shots. This enabled her to start a career as a model and she was soon featured on the front of many magazine covers.',,'2','15:46 06/02/2017','kumar');
INSERT INTO `documentup` (`id`,`catego`,`caption`,`filenmae`,`key1`,`key2`,`key3`,`descrip`,`files`,`image`,`ratings`,`date`,`username`) VALUES 
 (31,'TOURIST','FAMOUSPLACE','JAIN TEMPLE','worship','Rajasthan','Jain temple','Jain temple is the place of worship','A Jain temple is the place of worship for Jains, the followers of Jainism, Derasar is a word used for a Jain temple in Gujarat and Rajasthan. Basadi is a Jain shrine or temple. The word is generally used in South India, as well as in Maharashtra. ',,'1','15:50 06/02/2017','kumar'),
 (32,'TOURIST','FAMOUSPLACE','INDIAN STATE','Indo-Aryan','Himalayas','south','Ladakh is a region in Indian state of Jammu','Ladakh is a region in Indian state of Jammu and Kashmir that currently extends from the Kunlun mountain range to the main Great Himalayas to the south, inhabited by people of Indo-Aryan and Tibetan descent.',,'0','15:54 06/02/2017','kumar');
INSERT INTO `documentup` (`id`,`catego`,`caption`,`filenmae`,`key1`,`key2`,`key3`,`descrip`,`files`,`image`,`ratings`,`date`,`username`) VALUES 
 (33,'SPORTS','HANDBALL','OLYMPICS','games','womens handball','Olympic Games ','Handball was first introduced at the Olympic Games at the 1936 Olympics in Berlin','Handball was first introduced at the Olympic Games at the 1936 Olympics in Berlin (see Field Handball 1936), in a competition for men only, and was played outdoors on a grass surface. The sport was dropped from the program after this single appearance, and not played again until 1952, when field handball was again played, though this time as a demonstration sport (see Field Handball 1952).\r\nThe sport returned as an official sport for the 1972 Olympics, in its current format as an indoor sport. The women\'s handball competition was added to the program at \r\n',,'0','16:50 06/02/2017','DENCY'),
 (34,'PEOPLES','FAMOUSPERSON','MARTIN LUTHER KING','famous persons','King','significant political','Martin Luther King Jr was one of America?s most influential civil','Martin Luther King Jr was one of Americas most influential civil rights activists. His passionate, but non violent protests, helped to raise awareness of racial inequalities in America, leading to significant political change. Martin Luther King was also an eloquent orator who captured the imagination and hearts of people, both black and white.',,'0','16:52 06/02/2017','DENCY');
INSERT INTO `documentup` (`id`,`catego`,`caption`,`filenmae`,`key1`,`key2`,`key3`,`descrip`,`files`,`image`,`ratings`,`date`,`username`) VALUES 
 (35,'SPORTS','BASKETBALL','OLYMPICS','Olympic games','womens basketball ','games','Basketball was admitted as an Olympic sport for the first time in 1936 in Berlin, and has been on the program ever since','Basketball was admitted as an Olympic sport for the first time in 1936 in Berlin, and has been on the program ever since. A women\'s basketball tournament was added in 1976.\r\nIn 1936, the first ever final was played on a dirt court in the rain, which made dribbling impossible. The United States team beat Canada 19 to 8.\r\nIn 1972, the U.S. basketball team lost a game for the first time, defeated by the Soviet Union. However, the US team refused to accept the silver medal, claiming that the clock had been improperly restarted in the final moments.\r\nIn 1992, with the door open to professional athletes, the U.S. sent a \'Dream Team\' including Charles Barkley, Larry Bird, Magic Johnson, Michael Jordan, and Karl Malone. As expected, they went undefeated throughout the tournament.\r\n',,'0','17:41 06/02/2017','DENCY');
